    <body>
        <style>
            .tools {
                display: none;
            }
            #left a {
                display: table;
                padding: 10px;
                background-color: #ddd;
                border: 1px #ccc solid;
                color: #333;
                float: left;
            }
        </style>
        <div id="stage"></div>
        <div id="frames" class="tools"></div>

        <div id="left" class="tools">
            Title: <input name="title" value="Título do jogo">
            <br>
            Novo objeto: <input name="new-object" value="Objeto">
            <br>
            Objeto:
            <select name="object">
                <option value="0">Objeto 1</option> <!-- Objeto adicionado pelo user -->
                <option value="1">Objeto 2</option> <!-- Objeto adicionado pelo user -->
            </select>
            <br>
            Tipo de objeto
            <select name="type">
                <option>Background</option>
                <option>Player</option> <!-- Player/Partner/Person/Enemy -->
                <option>Object</option>
                <option>Chapter</option> <!-- Criar um fase pro jogo -->
            </select>
            <br>
            <div id="colors"></div>
            <div style="clear: both;"></div>
            Teclas utilizadas nesse objeto
            <div id="keys"></div>
            <div style="clear: both;"></div>
            <div style="display: none;">
                <!--Configurações-->
                Width: <input name="width" value="136">
                <br>
                Height: <input name="height" value="62">
                <br>
                Tamanho dos blocos: <input name="block" value="5">
                <br>
                Fps: <input name="fps" value="10">
                <br>
                <br>
                <br>
            </div>
            Frame label: <input name="label">
            <br>
            Next frame: <input name="next_frame">
            <br>
            Next object: <input name="next_object">
            <br>
            Key: <select name="key">
                <option value="">None</option>
                <option value="13">Enter</option>
                <option value="27">ESC</option>
                <option value="65">A</option>
                <option value="66">B</option>
                <option value="67">C</option>
                <option value="68">D</option>
                <option value="69">E</option>
                <option value="70">F</option>
                <option value="71">G</option>
                <option value="72">H</option>
                <option value="73">I</option>
                <option value="74">J</option>
                <option value="75">K</option>
                <option value="76">L</option>
                <option value="77">M</option>
                <option value="78">N</option>
                <option value="79">O</option>
                <option value="80">P</option>
                <option value="81">Q</option>
                <option value="82">R</option>
                <option value="83">S</option>
                <option value="84">T</option>
                <option value="85">U</option>
                <option value="86">V</option>
                <option value="87">W</option>
                <option value="88">X</option>
                <option value="89">Y</option>
                <option value="90">Z</option>
            </select>
            <br>
            <div style="display: none;">
                <!--usado em eventos-->
                HP: <input name="hp">
                <br>
                MP: <input name="mp">
                <br>
                ATK: <input name="atk">
                <br>
                DEF: <input name="def">
                <br>
            </div>
            <!--IDÉIA: Poder adicionar mais de uma tecla ou uma sequência de teclas-->
            <!--<div style="display: none;">-->
            Key type: <select name="key_type">
                <option value="key_down">KeyDown</option>
                <option value="key_up">KeyUp</option>
                <option value="key_down_hold">KeyDown (Hold)</option>
                <option value="key_up_hold">KeyUp (After hold)</option>
            </select>
            <br>
            Event: <select name="type">
                <option value="none">None</option>
                <option value="jump">Jump</option>
                <option value="crouch">Crouch</option>
                <option value="fire">Fire</option> <!-- Fire ou Power -->
            </select>
            <br>
            Sound: <select name="sound">
                <option value="none">None</option>
            </select>
            <br>
            <!--</div>-->
            <div style="clear: both;"></div>
            <a onclick="addFrame()">add frame</a>
            <a onclick="copyFrame()">copy frame</a>
            <a onclick="pasteFrame()">paste frame</a>
            <!--<a onclick="duplicateFrame()">duplicate frame</a>-->
            <!--<a onclick="copyLastFrame()()">copy last frame</a>-->
            <div style="clear: both;"></div>
            <a onclick="playPause();" id="playPause">Play</a>
            <!--<a onclick="pause();">Pause</a>-->
            <a onclick="stop();">Stop</a>
            <!--<a onclick="setup();">Clear</a>-->
            <!--<a onclick="removeFrame();">Remove</a>-->
            <!--<a onclick="saveMe();">Save</a>-->
            <div style="clear: both;"></div>
            <a onclick="tool = 'draw';">Draw</a>
            <!--<a onclick="tool = 'move';">Move</a>-->
            <a onclick="tool = 'paint';">Paint</a>
            <a onclick="tool = 'get';">Conta gotas</a>
            <a onclick="tool = 'select';">Select</a> <!-- Ferramenta de seleção -->
            <a onclick="copySelected();">Copy selected</a>
            <a onclick="pasteSelected();">Paste selected</a>
            <div style="clear: both;"></div>
            <center>
                <a onclick="moveFrame('up');">UP</a>
                <div style="clear: both;"></div>
                <a onclick="moveFrame('left');">Left</a>
                <a onclick="moveFrame('down');">Down</a>
                <a onclick="moveFrame('right');">Right</a>
            </center>
            <a onclick="saveGame();">Save game</a>
            <div style="clear: both;"></div>
            <!--<a onclick="tool = 'line';">Line</a>-->
        </div>
