            function changeColor(from, to) {
                var pxs = game['objects'][countObject]['frames'][actualFrame]['pixels'];
                for (var i = 0; i < pxs.length; i++) {
                    if (pxs[i]) {
                        var x = Number(pxs[i].split(',')[0]);
                        var y = Number(pxs[i].split(',')[1]);
                        var c = Number(pxs[i].split(',')[2]);
