            function pixel(x, y, r, g, b, a) {
                pixels[x][y] = r + ',' + g + ',' + b;
//                fill(r, g, b, a);
//                if (playing) {
//                    stroke(r, g, b);
//                } else {
//                    stroke(255, 255, 255);
