            }
            function drawPixels() {
//                background(255);
                s = Number($('[name=block]').val());
                for (var x = 0; x < rows; x++) {
                    for (var y = 0; y < cols; y++) {
                        var r = 255;
                        var g = 255;
                        var b = 255;
                        if (typeof pixels[x][y] !== "undefined" && pixels[x][y] !== lastPixels[x][y]) {
                            lastPixels[x][y] = pixels[x][y];
                            var sp = pixels[x][y].split(',');
                            r = sp[0];
                            g = sp[1];
                            b = sp[2];
                            fill(r, g, b, 255);
                            if (playing) {
                                stroke(r, g, b);
                            } else {
                                stroke(255, 255, 255);
                            }
                            rect(((x - 1 + 1) * s), h - ((y + 1) * s), s, s);
                        } else if (lastPixels[x][y] !== pixels[x][y]) {
                            pixels[x][y] = r + ',' + g + ',' + b;
                            lastPixels[x][y] = pixels[x][y];
                            fill(r, g, b, 255);
                            if (playing) {
                                stroke(r, g, b);
                            } else {
                                stroke(255, 255, 255);
                            }
                            rect(((x - 1 + 1) * s), h - ((y + 1) * s), s, s);

                        }

                    }
                }
            }
            var playing = false;
