                                        if (actualColor !== color_) {
//                                    game['objects'][countObject]['frames'][actualFrame]['pixels'][i] = x + "," + y + "," + actualColor;
                                            game['objects'][countObject]['frames'][actualFrame]['pixels'][i] = null;
                                        }
                                    }
                                }
                            }
                            if (insertPixel) {
