//                        game['objects'][countObject]['frames'][actualFrame]['pixels'][countPixel] = posX + "," + posY + "," + actualColor;
                                countPixel++;
                                $('#save').val(str_replace(',null', '', JSON.stringify(game)));
                            }
                        } else if (tool === 'copy') {
                            //copiar objeto, cor ou geral
                        } else if (tool === 'move') {
                        } else if (tool === 'paint') {
                            //pintar elemento ou fundo
                            var pxs = game['objects'][countObject]['frames'][actualFrame]['pixels'];
                            var insertPixel = true;
                            for (var i = 0; i < pxs.length; i++) {
                                if (pxs[i]) {
                                    var xx = Number(pxs[i].split(',')[0]);
                                    var yy = Number(pxs[i].split(',')[1]);
                                    var color_ = Number(pxs[i].split(',')[2]);
                                    if (xx === x && yy === y) {
                                        insertPixel = false;
                                        //tinge os pixels da mesma cor

                                        //##############
                                        changeColor(color_, actualColor);

                                    }
                                }
                            }
                            if (insertPixel) {
                                //tinge os pixels vazios
                            }
                        } else if (tool === 'get') {
                            var pxs = game['objects'][countObject]['frames'][actualFrame]['pixels'];
                            var insertPixel = true;
                            for (var i = 0; i < pxs.length; i++) {
                                if (pxs[i]) {
                                    var xx = Number(pxs[i].split(',')[0]);
                                    var yy = Number(pxs[i].split(',')[1]);
                                    var color_ = Number(pxs[i].split(',')[2]);
                                    if (xx === x && yy === y) {
                                        insertPixel = false;
                                        //tinge os pixels da mesma cor

                                        //##############
                                        actualColor = color_;
                                        tool = 'draw';

                                    }
                                }
                            }
                            if (insertPixel) {
                                //tinge os pixels vazios
                            }
                        }
                    }
                }
            }).keyup(function (e) {

                if (e.keyCode === 27) {
//                    alert('Sair');
                    tools = !tools;
                    if (tools) {
                        $('.tools').show();
                        if (playing) {
                            playPause();
                        }
                    } else {
                        $('.tools').hide();
//                        if (!playing) {
//                             playPause();
//                        }
                    }
                }
                if (!playing) {
                    if (e.keyCode === 13) {
                        playPause();
                    }
//                    if (e.keyCode === 80) {
//                        //letra p
//                        playPause();
//                        if (playing) {
//                            tools=false;
//                            $('.tools').hide();
//                        } else {
//                            tools=true;
//                            $('.tools').show();
//                        }
//                    }
                    if (e.keyCode === 37) {
                        //seta pra esquerda - frame anterior
                        if (actualFrame > 0) {
                            actualFrame--;
                            loadFrame(actualFrame);
                        } else {
                            loadFrame(countFrame - 1);
                        }
                    }
                    if (e.keyCode === 39) {
                        //seta pra direita - próximo frame
                        if (actualFrame === countFrame - 1) {
                            actualFrame = 0;
                            loadFrame(0);
                        } else {
                            actualFrame++;
                            loadFrame(actualFrame);
                        }
                    }
                }

                if (playing) {

                    if (typeof game['objects'][countObject]['frames'] !== "undefined") {
                        var ff = game['objects'][countObject]['frames'];
                        for (var i = 0; i < ff.length; i++) {
                            if (
                                    ff[i]['key'] && e.keyCode === Number(ff[i]['key']) ||
                                    e.keyCode === 65 && ff[i]['key'] && (ff[i]['key'] === 'a' || ff[i]['key'] === 'A') ||
                                    e.keyCode === 66 && ff[i]['key'] && (ff[i]['key'] === 'b' || ff[i]['key'] === 'B') ||
                                    e.keyCode === 67 && ff[i]['key'] && (ff[i]['key'] === 'c' || ff[i]['key'] === 'C') ||
                                    e.keyCode === 68 && ff[i]['key'] && (ff[i]['key'] === 'd' || ff[i]['key'] === 'D') ||
                                    e.keyCode === 69 && ff[i]['key'] && (ff[i]['key'] === 'e' || ff[i]['key'] === 'E') ||
                                    e.keyCode === 70 && ff[i]['key'] && (ff[i]['key'] === 'f' || ff[i]['key'] === 'F') ||
                                    e.keyCode === 71 && ff[i]['key'] && (ff[i]['key'] === 'g' || ff[i]['key'] === 'G') ||
                                    e.keyCode === 72 && ff[i]['key'] && (ff[i]['key'] === 'h' || ff[i]['key'] === 'H') ||
                                    e.keyCode === 73 && ff[i]['key'] && (ff[i]['key'] === 'i' || ff[i]['key'] === 'I') ||
                                    e.keyCode === 74 && ff[i]['key'] && (ff[i]['key'] === 'j' || ff[i]['key'] === 'J') ||
                                    e.keyCode === 75 && ff[i]['key'] && (ff[i]['key'] === 'k' || ff[i]['key'] === 'K') ||
                                    e.keyCode === 76 && ff[i]['key'] && (ff[i]['key'] === 'l' || ff[i]['key'] === 'L') ||
                                    e.keyCode === 77 && ff[i]['key'] && (ff[i]['key'] === 'm' || ff[i]['key'] === 'M') ||
                                    e.keyCode === 78 && ff[i]['key'] && (ff[i]['key'] === 'n' || ff[i]['key'] === 'N') ||
                                    e.keyCode === 79 && ff[i]['key'] && (ff[i]['key'] === 'o' || ff[i]['key'] === 'O') ||
                                    e.keyCode === 80 && ff[i]['key'] && (ff[i]['key'] === 'p' || ff[i]['key'] === 'P') ||
                                    e.keyCode === 81 && ff[i]['key'] && (ff[i]['key'] === 'q' || ff[i]['key'] === 'Q') ||
                                    e.keyCode === 82 && ff[i]['key'] && (ff[i]['key'] === 'r' || ff[i]['key'] === 'R') ||
                                    e.keyCode === 83 && ff[i]['key'] && (ff[i]['key'] === 's' || ff[i]['key'] === 'S') ||
                                    e.keyCode === 84 && ff[i]['key'] && (ff[i]['key'] === 't' || ff[i]['key'] === 'T') ||
                                    e.keyCode === 85 && ff[i]['key'] && (ff[i]['key'] === 'u' || ff[i]['key'] === 'U') ||
                                    e.keyCode === 86 && ff[i]['key'] && (ff[i]['key'] === 'v' || ff[i]['key'] === 'V') ||
                                    e.keyCode === 87 && ff[i]['key'] && (ff[i]['key'] === 'w' || ff[i]['key'] === 'W') ||
                                    e.keyCode === 88 && ff[i]['key'] && (ff[i]['key'] === 'x' || ff[i]['key'] === 'X') ||
                                    e.keyCode === 89 && ff[i]['key'] && (ff[i]['key'] === 'y' || ff[i]['key'] === 'Y') ||
                                    e.keyCode === 90 && ff[i]['key'] && (ff[i]['key'] === 'z' || ff[i]['key'] === 'Z')
                                    ) {
                                framePlay = i;
                                loadFrame(i);
                            }
                        }
                    }
                }
            });
